--在MDM数据库中更新BlendAdditiveMeasureUnit的关联表的相关字段
update mu
set 
mu.MeaureUnitTypeName=mut.Name,
mu.MeaureUnitTypeDescription=mut.Description,
mu.MeaureUnitTypeSystemId=mut.system_id,
mu.MeasureUnitSystemName=mus.Name,
mu.MeasureUnitSystemDescription=mus.Description,
mu.MeasureUnitSystemSystemId=mus.system_id
from BlendAdditiveMeasureUnit mu 
left join MeasureUnitType mut on mu.MeaureUnitTypeId=mut.id 
left join MeasureUnitSystem mus on mu.MeasureUnitSystemId=mus.id;


--在MDM数据库中更新BlendChemical的关联表的相关字段
update bc
set 
bc.ProductName=pd.Name,
bc.ProductDescription=pd.Description,
bc.ProductSystemId=pd.system_id,
bc.AdditiveTypeName=ad.Name,
bc.AdditiveTypeDescription=ad.Description,
bc.AdditiveTypeSystemId=ad.system_id,
bc.BaseBlendTypeName=bf.Name,
bc.BaseBlendTypeDescription=bf.Description,
bc.BaseBlendTypeSystemId=bf.system_id,
bc.BlendPrimaryCategoryName=bp.Name,
bc.BlendPrimaryCategoryDescription=bp.Description,
bc.BlendPrimaryCategorySystemId=bp.system_id,
bc.BlendRecipeName=br.Name,
bc.BlendRecipeDescription=br.Description,
bc.BlendRecipeSystemId=br.system_id
from BlendChemical bc 
left join Product pd on bc.ProductId=pd.id 
left join AdditiveType ad on bc.AdditiveTypeId=ad.id
left join BlendFluidType bf on bc.BaseBlendTypeId=bf.id
left join BlendPrimaryCategory bp on bc.BlendPrimaryCategoryId=bp.id
left join BlendRecipe br on bc.BlendRecipeId=br.id;


--在MDM数据库中更新BlendChemicalSection的关联表的相关字段
update bcs
set 
bcs.BlendChemicalName=bc.Name,
bcs.BlendChemicalDescription=bc.Description,
bcs.BlendChemicalSystemId=bc.system_id,
bcs.BlendRecipeName=br.Name,
bcs.BlendRecipeDescription=br.Description,
bcs.BlendRecipeSystemId=br.system_id,
bcs.UnitDescription=mu.Description,
bcs.UnitSystemId=mu.system_id,
bcs.AdditionMethodName=am.Name,
bcs.AdditionMethodDescription=am.Description,
bcs.AdditionMethodSystemId=am.system_id,
bcs.AdditiveBlendMethodName=abm.Name,
bcs.AdditiveBlendMethodDescription=abm.Description,
bcs.AdditiveBlendMethodSystemId=abm.system_id		
from BlendChemicalSection bcs 
left join BlendChemical bc on bcs.BlendChemicalId=bc.id
left join BlendRecipe br on bcs.BlendRecipeId=br.id
left join BlendAdditiveMeasureUnit mu on bcs.UnitId=mu.id
left join AdditionMethod am on bcs.AdditionMethodId=am.id
left join AdditiveBlendMethod abm on bcs.AdditiveBlendMethodId=abm.id;


